import { useParams } from "react-router-dom";
import { useEffect, useState } from "react";
import SimmerUi from "./ShimmerUi";
import useRestaurant from "../utils/useRestaurant";
import useRestaurantCard from "../utils/useRestaurantCard";
import useOffer from "../utils/useOffer";

const RestaurantMenu = () => {
  const img =
    "https://media-assets.swiggy.com/swiggy/image/upload/fl_lossy,f_auto,q_auto,w_660/";

  const { id } = useParams();
  // this is for the dynamic id
  // restaurant  use param is responsible to find out the id

  const restaurant = useRestaurant(id);
  const restaurantCard = useRestaurantCard([], id);
  // here use pass the [] and id because we want the data for the particular card

  const offer = useOffer(id, []);

  // when restaurant is not present then simmer will show otherwise restaurant will show
  return !restaurant ? (
    <SimmerUi />
  ) : (
    <>
      <div className="singlePageWrapper">
        <h2>{restaurant.name}</h2>
        <div className="fullpageCard">
          <p>Outlate :{restaurant.locality}</p>
          <ul>
            <li>Rating : {restaurant.avgRating}</li>
            <li>costForTwo : {restaurant.costForTwo}</li>
          </ul>
          <p className="info">{restaurant.cuisines.join(", ")}</p>
        </div>
        <div className="fullpageCardDetail">
          <img
            className="fullpageimg"
            src={img + restaurant.cloudinaryImageId}
            alt="Restaurant"
          />
          <h3>
            <span className="labelOfCardFullPage">Area Name : </span>
            {restaurant.areaName}
          </h3>
          <h3>
            <span className="labelOfCardFullPage">City : </span>
            {restaurant.city}
          </h3>
          <h3>
            <span className="labelOfCardFullPage">Rating : </span>
            {restaurant.avgRating}
          </h3>
          <h3>
            <span className="labelOfCardFullPage">Cost for Two :</span>
            {restaurant.costForTwoMessage}
          </h3>
        </div>

        <div>
          <ul>
            {restaurantCard.map((item) => (
              <li key={item?.card?.info?.id} className=" list ">
                <div className="listCard ">
                  <div>
                    <p>{item?.card?.info?.name}</p>
                    <p>{item?.card?.info?.price}</p>
                  </div>
                  <img className="" src={img + item?.card?.info?.imageId}></img>
                </div>
              </li>
            ))}
          </ul>
        </div>
      </div>
    </>
  );
};

export default RestaurantMenu;
